import axios from "axios";
const apiKey = "02db759b07f1f101894f467954dac6a7"


function App() {
let queryUrl = "api.openweathermap.org/data/2.5/weather?q=London"
  useEffect(()=> {
    axios.get(queryUrl,{
      params: {
        key: "",
        part: "",
        q: "term",
        maxResults: ""
      }
    })
  },[])
  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
